import React, { useEffect } from 'react';
import api from '../api/axios';


const Auth = () => {
  useEffect(() => {
    const urlParams = new URLSearchParams(window.location.search);
    const code = urlParams.get('code');
    //const state = urlParams.get('state');
    const token_endpoint = "http://127.0.0.1:8000/o/token/"
    const client_id = "xwYKg1b4eazi2OPlObUOzBvZaqoQ7z866Bcd2dVx"
    const client_secret = "fa8K70L2nPaiUFQo47xp9xJRwVbq8Pg1yqZXXCRHo5I3wLG0B95NBLIwzXzPtkkIOvDyz9hpF3Ip8ZA6YeDigOMMmzuS5VArLyGN6SOfBXaPmcaqPA0mrKh1d4lO7hIR"
    data = {
      client_id,
      client_secret,
      code,
      //redirect_uri: redirect_uri,
      code_verifier: "SA69OYQKG31SGQ0LKMOYE4W4L3R0E2OMWDTLGDM5L1ZMN5KN5TCP2JKMO1",
      grant_type: "authorization_code",
    }

    api.post(token_endpoint, data)
      .then(response => {
        console.log(response);
      })
  }, []);
  return (
    <div> Logging in...</div>
  );
}

export default Auth;
